selector_to_html = {"a[href=\"#exerciseex49\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex49\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 64 </span></p>\n<section id=\"exercise-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exercises-4\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Exercises 4<a class=\"headerlink\" href=\"#exercises-4\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#exerciseex44\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex44\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 59 </span></p>\n<section id=\"exercise-content\">\n<p>a.\tWrite a program that asks the user for a number and then classifies the number as being either: less than 10, between 10 and 100, between 100 and 1000, or greater than 1000.\nb.\tModify the last program, to also identify if the number is an integer or not.\nc.\tModify the last program to handle input that is not a number correctly.</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex45\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex45\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 60 </span></p>\n<section id=\"exercise-content\">\n<p>Write a program that will take the coefficients for a quadratic equation from the user, and return the number, and type of solutions, and the solutions.</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex43\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex43\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 58 </span></p>\n<section id=\"exercise-content\">\n<p>Evaluate:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\nP_3=\\prod_(i=1)^\\infty \\left(1+(x^(2^i)\\right )\\ ;\\ |x|&lt;1\n\\]</div>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex46\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex46\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 61 </span></p>\n<section id=\"exercise-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex410\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex410\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 65 </span></p>\n<section id=\"exercise-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex47\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex47\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 62 </span></p>\n<section id=\"exercise-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex48\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex48\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 63 </span></p>\n<section id=\"exercise-content\">\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex42\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex42\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 57 </span></p>\n<section id=\"exercise-content\">\n<p>Use a for-statement to evaluate the equation:\n$<span class=\"math notranslate nohighlight\">\\(\nS_3=\\sum_(i=0)^\\infty \\frac{(-1)^(i+1)}{i^2}\n\\)</span>$</p>\n<p>Hint: You cannot actually use infinity\u2026</p>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>", "a[href=\"#exerciseex41\"]": "<div class=\"exercise dropdown admonition\" id=\"exerciseex41\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Exercise 56 </span></p>\n<section id=\"exercise-content\">\n<p>Write code that produces the following outputs to the terminal. You should use a for-loop. Each consecutive line should display the next value in a:</p>\n<ul class=\"simple\">\n<li><p>count from 0 to 10, in steps of 1.</p></li>\n<li><p>a countdown from 20 to 0 in steps of 0.5.</p></li>\n<li><p>a count up, in steps of 3, from 100 to 121.</p></li>\n<li><p>the multiplication table for 7x.</p></li>\n<li><p>adapt the previous part so that it can produce any multiplication table, for a given number of terms i.e. the 11 times table for 15 terms, so up to 11\u00d715 at the users request.</p></li>\n</ul>\n<div class=\"cell tag_remove-output tag_skip-execution docutils container\">\n<div class=\"cell_input docutils container\">\n<div class=\"highlight-C++ notranslate\"><div class=\"highlight\"><pre><span></span><span class=\"n\">Code</span><span class=\"w\"> </span><span class=\"n\">goes</span><span class=\"w\"> </span><span class=\"n\">here</span><span class=\"p\">....</span>\n</pre></div>\n</div>\n</div>\n</div>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false, theme: 'material', duration: [200, 100], delay: [200, 0],

            });
        };
    };
    console.log("tippy tips loaded!");
};
